Everglades

Nature Documentary hosted by Craig Sechler, published by National Geographic broadcasted as part of NG Access 360 World Heritage series in 2014 - English narration


Information
------------------------------

Access 360 World Heritage: Everglades
Everglades National Park is under siege. A full-scale invasion of escaped pets and exotic species threatens to wipe out the local wildlife, and a snarling system of dams and canals is slowly strangling its fragile ecosystem. The threat is so severe that UNESCO has put the park on their list of most vulnerable locations. Now, the defenders of this World Heritage Site are fighting back to fend off the onslaught of invaders and pump life back into the legendary river of grass before it's too late.

